As we celebrate International Women’s Day, which recognizes the social, cultural, environmental and political achievements of women while advocating gender equality, inclusivity and equity, we are thrilled to announce this year’s Women Empowerment Awards presented by @rogers with Lead Sponsor @mantellacorporation! 

The awards are a platform and initiative created to recognize the remarkable achievements made by diverse Canadian women.  They are designed to empower women as key change makers in our community, support female entrepreneurs with their business and to help them advance in their careers. 

Join us again in nominating and celebrating exceptional women in the following categories:

-Businesswoman of the Year
-Leadership Award
-Diversity, Equality & Inclusivity Award
-Rogers Communications Entrepreneur Grant Award
-Mentorship Award
-Innovator Award
-Global Impact Award
-Mantella Corporation Entrepreneur BIPOC Grant Award
-Lifetime Achievement Award
-Rising Star Award

For more information about each award, visit our website at www.woea.ca/awards or the following link in our bio!

Nominations are open from now until June 1st, 2023.  We rise by lifting others. 🙌🏻

🎥 @tveproductions

