We are officially SOLD OUT of our second annual Women Empowerment Awards presented by Rogers Communications Inc. with Lead Sponsor Mantella Corporation.

We are so excited in having you join us in celebrating the strength, resilience, and outstanding contributions of women across Canada and be a part of an inspiring evening filled with stories of triumph, recognition of excellence, and the unstoppable force of women empowerment.

